DROP MATERIALIZED VIEW IF EXISTS stream_query;
CREATE MATERIALIZED VIEW stream_query AS SELECT t_2.col_3 AS col_0, (REAL '601') AS col_1 FROM m9 AS t_2 GROUP BY t_2.col_3;
DROP MATERIALIZED VIEW IF EXISTS stream_query;
CREATE MATERIALIZED VIEW stream_query AS SELECT hop_0.c3 AS col_0, hop_0.c3 AS col_1 FROM hop(alltypes1, alltypes1.c11, INTERVAL '484488', INTERVAL '9689760') AS hop_0 WHERE false GROUP BY hop_0.c3 HAVING false;
DROP MATERIALIZED VIEW IF EXISTS stream_query;
